import styled from 'styled-components';
const Room = ({ roomDatas }) => {
  function makeRoom(roomDatas) {
    const result = [];
    roomDatas.map((roomData) => {
      result.push(
        <Board
          thumbnail={roomData.thumbnaiul}
          title={roomData.title}
          tags={roomData.tags}
          room_status={roomData.status}
          expected_user={roomData.expected_user}
        ></Board>
      );
    });
    return result;
  }
  return (
    <RoomBox>
      <Board>게시판</Board>
      <Board>게시판</Board>
