      <Board>게시판</Board>
      <Board>게시판</Board>
      <Board>게시판</Board>
    </RoomBox>
  );
};
export default Room;

const RoomBox = styled.div`
  overflow-y: auto;
  border-radius: 10px;
  margin: 10px;
  padding: 10px;
  display: flex;
  flex-basis: 100%;
  flex-wrap: wrap;
  justify-contenet: center;
  background-color: rgba(217, 217, 217, 0.6); //#d9d9d9
  @media screen and (max-width: 1335px) {
    flex-basis: 75%;
  }
`;

const Board = styled.div`
  flex-basis: 45%;
  height: 20%;
  border-radius: 10px;
  margin: 10px;
  padding: 10px;
  justify-contenet: center;
  background-color: #ffffff;
  @media screen and (max-width: 1335px) {
    flex-basis: 100%;
    height: 10%;
  }
`;
